import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";
import headerLogo from './assets/Hearts_2.png';
import "./index.css";

function Navbar() {
  return (
    <span>
      <div class="logo">
          <Link to="/"><img src={headerLogo} width="75" height="75"></img></Link>
          <h6>Hearts of Love</h6> 
      </div>
      
        <div class="links">
          <Link to="/" class="link">Home</Link>
          <Link to="/about" class="link">About</Link>
          <Link to="/join" class="link">Join Us!</Link>
          <Link to="/resources" class="link">Resources</Link>
          <Link to="/shop" class="link">Shop</Link>
          <Link class="link">Contact Us</Link>
        </div>
    </span>
  );
}

export default Navbar;
